DROP TABLE IF EXISTS oceny;
DROP TABLE IF EXISTS studenci;
DROP TABLE IF EXISTS kierunki;

CREATE TABLE kierunki (
  id INT AUTO_INCREMENT PRIMARY KEY,
  nazwa VARCHAR(100) NOT NULL
);


CREATE TABLE studenci (
  id INT AUTO_INCREMENT PRIMARY KEY,
  imie VARCHAR(50),
  nazwisko VARCHAR(50),
  email VARCHAR(100) UNIQUE,
  rok_studiow INT,
  kierunek_id INT,
  FOREIGN KEY (kierunek_id) REFERENCES kierunki(id)
);


CREATE TABLE oceny (
  id INT AUTO_INCREMENT PRIMARY KEY,
  student_id INT,
  przedmiot VARCHAR(100),
  ocena DECIMAL(3,1),
  data_oceny DATE,
  FOREIGN KEY (student_id) REFERENCES studenci(id)
);

